  HADFIELD, Anthony Barry and BRIGHT, Belinda Mary (cont...)
  in 1982 and MAgrSci(Hons) in 1993 from Massey University. After their marriage, he and Belinda
  spent two years overseas including a year in South Africa working at the University of
  Pietermaritzburg. In 1984 they milked cows on the family farm while the Lindale Farm Tourist
  Centre was being developed on the same property then worked at Lindale Farm until 1987 when the
  complex was sold. They set up their own contracting business in mid-1987. Anthony is now employed
  at the Foundation for Research, Science and Technology as a project analyst for TBG. Belinda
  enjoys eventing and gardening.
